import React, { useEffect } from "react";

const Home = () => {
  useEffect(() => {
    function myMenuFunction() {
      var i = document.getElementById("navMenu");

      if (i.className === "nav-menu") {
        i.className += " responsive";
      } else {
        i.className = "nav-menu";
      }
    }

    var a = document.getElementById("loginBtn");
    var b = document.getElementById("registerBtn");
    var x = document.getElementById("login");
    var y = document.getElementById("register");

    function login() {
      x.style.left = "4px";
      y.style.right = "-520px";
      a.className += " white-btn";
      b.className = "btn";
      x.style.opacity = 1;
      y.style.opacity = 0;
    }

    function register() {
      x.style.left = "-510px";
      y.style.right = "5px";
      a.className = "btn";
      b.className += " white-btn";
      x.style.opacity = 0;
      y.style.opacity = 1;
    }
    
    // Attach event listeners
    document.getElementById("navMenuBtn").addEventListener("click", myMenuFunction);
    document.getElementById("loginBtn").addEventListener("click", login);
    document.getElementById("registerBtn").addEventListener("click", register);

    // Cleanup - remove event listeners when the component is unmounted
    return () => {
      document.getElementById("navMenuBtn").removeEventListener("click", myMenuFunction);
      document.getElementById("loginBtn").removeEventListener("click", login);
      document.getElementById("registerBtn").removeEventListener("click", register);
    };
  }, []);

  return (
    <div>
      {/* Your existing JSX content */}
    </div>
  );
};

export default Home;
